    func tableView(_ tableView: UITableView, numberOfRowsInSection section: Int) -> Int {
        return ucuslar.count
    }
    
    func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = secimTableView.dequeueReusableCell(withIdentifier: "ucuslar", for: indexPath) as! SecimTableViewCell
        let ucus = ucuslar[indexPath.row]
        cell.nereden.text = "\(ucus.nereden)"
        cell.nereye.text = "\(ucus.nereye)"
        cell.saat.text = "\(ucus.kalkisSaati)"
        cell.sure.text = "\(ucus.sure)"
        cell.ucret.text = "\(ucus.ucret) TL"
        cell.ucusNo.text = "Uçuş No: \(ucus.ucusKodu)"
     
        return cell
    }
    
    func tableView(_ tableView: UITableView, didSelectRowAt indexPath: IndexPath) {
        selectedUcus = ucuslar[indexPath.row]
        performSegue(withIdentifier: "toKoltukVC", sender: nil)
    }
    
    override func prepare(for segue: UIStoryboardSegue, sender: Any?) {
        if segue.identifier == "toKoltukVC" {
            if let destinationVC = segue.destination as? KoltukSecViewController {
                destinationVC.ucus = selectedUcus
